import React, { Component } from 'react';
import FinalForm from './test_input';


export default class NotFound extends Component{
    constructor() {
        super();
        this.state = {
            res: [],
        }
    }

    componentDidMount() {

    }

    handleSubmit(){
        // console.log(this.state.dataFinal);
        console.log('submit');
    }

    getDataForPdf(e) {
        e.preventDefault();
        this.setState({ res: [... this.state.res, e] })
        // console.log(e);
        console.log(this.state.res);
    }

    render(){

        return(
            <div>
            <form onSubmit={(e) => this.handleSubmit(e).bind(this)}>
                <FinalForm getDataForPdf={this.getDataForPdf.bind(this)} />
            </form>
            <div className="text-center">
                <input type="submit" value="Submit" className="degrade-btn btn" style={{ borderRadius: '5%', width: '15vh', marginTop: "3%"}} />
            </div>
            </div>
        )
    }
}
